 CREATE TABLE IF NOT EXISTS EXPORT33(
COMPANYID NUMERIC(16,2),
NOMBREDELAEMPRESA VARCHAR(100),
PROPIETARIODELREGISTRODEEMPRESA VARCHAR(100),
FECHADECREACIYN TIMESTAMP,
PHONENUMBER VARCHAR(100),
FECHADELAYLTIMAACTIVIDAD TIMESTAMP,
CIUDAD VARCHAR(100),
PAYSREGIYN VARCHAR(100),
INDUSTRIA VARCHAR(100),
ESTADOREGIYN VARCHAR(100),
IDX  BIGSERIAL PRIMARY KEY  ); COMMENT ON COLUMN EXPORT33.COMPANYID IS 'origin column file Company ID';
 COMMENT ON COLUMN EXPORT33.NOMBREDELAEMPRESA IS 'origin column file Nombre de la empresa';
 COMMENT ON COLUMN EXPORT33.PROPIETARIODELREGISTRODEEMPRESA IS 'origin column file Propietario del registro de empresa';
 COMMENT ON COLUMN EXPORT33.FECHADECREACIYN IS 'origin column file Fecha de creaciýn';
 COMMENT ON COLUMN EXPORT33.PHONENUMBER IS 'origin column file Phone Number';
 COMMENT ON COLUMN EXPORT33.FECHADELAYLTIMAACTIVIDAD IS 'origin column file Fecha de la ýltima actividad';
 COMMENT ON COLUMN EXPORT33.CIUDAD IS 'origin column file Ciudad';
 COMMENT ON COLUMN EXPORT33.PAYSREGIYN IS 'origin column file Paýs/regiýn';
 COMMENT ON COLUMN EXPORT33.INDUSTRIA IS 'origin column file Industria';
 COMMENT ON COLUMN EXPORT33.ESTADOREGIYN IS 'origin column file Estado/regiýn';
